import TradingPage from "./component/TradingPage";
import Navbar from "./component/Navbar";
import Header from "./component/Header";
import Popular from "./component/Popular";
import { useEffect, useState } from "react";
function App() {
  const [price, setPrice] = useState(null);

  useEffect(() => {
    fetch(
      "https://api.coingecko.com/api/v3/simple/price?ids=bitcoin%2Cethereum%2Ccardano&vs_currencies=usd"
    )
      .then((res) => res.json())
      .then((data) => {
        setPrice(data);
      });
  }, []);

  return (
    <div className="App">
      <Navbar></Navbar>
      <Header></Header>
      {price && <Popular price={price.bitcoin} name="Bitcoin"></Popular>}
    </div>
  );
}

export default App;
